import React, { Component } from "react";
import { useState } from "react";

const [selectedFile, setSelectedFile] = useState();
const [isFilePicked, setIsFilePicked] = useState(false);

class AddDeal extends Deal {
  constructor(props) {
    super(props);

    this.state = {
      pret: " ",
      cC: " ",
      anF: " ",
      cP: " ",
      cU: " ",
      foto: " ",
    };
    this.changePretHandler = this.changePretHandler.bind(this);
    this.changeCCHandler = this.changeCCHandler.bind(this);
    this.changeAnFHandler = this.changeAnFHandler.bind(this);
    this.changeCPHandler = this.changeCPHandler.bind(this);
    this.changeCUHandler = this.changeCUHandler.bind(this);
    this.saveDeal = this.saveDeal.bind(this);
  }

  saveDeal = (e) => {
    e.preventDeafault();
    let Deal = {
      Pret: this.state.pret,
      CC: this.state.cC,
      An: this.state.anF,
      CP: this.state.cP,
      CU: this.state.cU,
      Foto: this.state.foto,
    };
    console.log("deal => " + JSON.stringify(deal));
  };
  changePretHandler = (event) => {
    this.setState({ pret: event.target.value });
  };

  changeCCHandler = (event) => {
    this.setState({ cC: event.target.value });
  };

  changeAnFHandler = (event) => {
    this.setState({ anF: event.target.value });
  };

  changeCPHandler = (event) => {
    this.setState({ cP: event.target.value });
  };

  changeCUHandler = (event) => {
    this.setState({ cU: event.target.value });
  };

  changeFotoHandler = (event) => {
    setSelectedFile(event.target.files[0]);
    setIsSelected(true);
  };

  handleSubmission = () => {
    const formData = new FormData();

    formData.append("File", selectedFile);

    fetch(
      "https://en.wikipedia.org/wiki/Ford_Focus#/media/File:2018_Ford_Focus_ST-Line_X_1.0.jpg" /*LINK PENTRU POZA*/,
      {
        method: "POST",
        body: formData,
      }
    );
  };

  render() {
    return (
      <div>
        <div className="container">
          <div className="row">
            <div className="card col-md-6 offset-md-3 offset-md-3">
              <h3 className="text-center"> Adauga Anunt </h3>
              <div className="card-body">
                <form>
                  <div className="form-group">
                    <label> Pret </label>
                    <input
                      placeholder="Pret"
                      name="pret"
                      className="form-control"
                      value={this.state.pret}
                      onChange={this.changePretHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> Capacitate cilindrica </label>
                    <input
                      placeholder="CC"
                      name="cC"
                      className="form-control"
                      value={this.state.cC}
                      onChange={this.changeCCHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> An fabricatie</label>
                    <input
                      placeholder="An fabricatie"
                      name="anF"
                      className="form-control"
                      value={this.state.anF}
                      onChange={this.changeAnFHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> Cai putere </label>
                    <input
                      placeholder="Cai putere"
                      name="cP"
                      className="form-control"
                      value={this.state.cP}
                      onChange={this.changeCPHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> Combustibil utilizat </label>
                    <input
                      placeholder="Combustibil utilizat"
                      name="cU"
                      className="form-control"
                      value={this.state.cU}
                      onChange={this.changeCUHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> Fotografie </label>
                    <input
                      placeholder="Fotografie"
                      name="foto"
                      className="form-control"
                      value={this.state.foto}
                      onChange={this.changeFotoHandler}
                    />
                    <div>
                      <button onClick={handleSubmission}>Submit</button>
                    </div>
                  </div>

                  <button className="btn btn-success" onClick={this.saveDeal}>
                    Save
                  </button>
                  <button
                    className="btn btn-dnager"
                    onClick={this.cancel.bind(this)}
                    style={{ marginLeft: "10px" }}
                  >
                    Cancel
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default AddDeal;
